import './App.css';
import logo from './imagenes/logo-rectagular.png';

function App() {
  return (
    <div className="aplicacion-tareas">
        <div className='logo-contenedor'>
          <img
            src={logo}
            className='logo'
            alt='logo del proyecto' 
          />
        </div>
        <div>
          <h1>MIS TAREAS</h1>
        </div>
    </div>
  );
}

export default App;
